import React from 'react';
import Heading from "./Heading";
import Paragraph from "./Paragraph";
import Cities from "./Cities";


function App(){
    return (
    <React.Fragment>
        <Heading/>
        <Paragraph/>
        <Cities/>
    </React.Fragment>);
}

export default App;
